const nastavnici = async (state = [], action) => {
  /*  if (action.type === 'GET_NASTAVNICI') {
    return state;
  } */
  if (action.type === 'GET_NASTAVNICI') {
    const nast = await fetch('http://localhost:3001/nastavnici');
    const response = await nast.json();
    console.log(response);
    return {
      type: 'GET_NASTAVNICI',
      data: response,
    };
  }
  return state;
};

export default nastavnici;
